import React from "react";
import $ from "jquery";

// function traeLibro ( state ) {
const traeLibro = ( state ) => {
	let input_buscar = $( "input.input_buscar" ).val();
	console.log( input_buscar );
	var todo = [];
	var algo = {
		"nombre" : "nnnnnnn" ,
		"apellido" : input_buscar ,
	}
	todo.push({nombre: algo.nombre , apellido: algo.apellido})
	console.log( todo );
	state( todo );
}

export {
	traeLibro
}
